import { useIsFocused } from "@react-navigation/native";
import React, { useEffect } from "react";
import {
  View,
  ScrollView,
  Text,
  StyleSheet,
  Dimensions,
  TouchableOpacity,
  Platform,
  KeyboardAvoidingView,
} from "react-native";
import Animated, { FadeIn } from "react-native-reanimated";
import { SafeAreaView } from "react-native-safe-area-context";
import { SvgXml } from "react-native-svg";
import { useDispatch } from "react-redux";
import DropDown from "../../components/DropDown";
import IconButton from "../../components/IconButton";
import Input from "../../components/Input";
import { setHideBottomBar } from "../../Reducers/hideBottomBar";
import { CheckBox } from "../Seller/Pricing";
const { width, height } = Dimensions.get("window");

export default function EditInstallmentService({ navigation, route }) {
  const dispatch = useDispatch();
  const isFocused = useIsFocused();
  const [SubscriptionType, setSubscriptionType] = React.useState();
  const [PayAsGo, setPayAsGo] = React.useState(false);
  const [OtherCharge, setOtherCharge] = React.useState(false);
  const params = route.params;
  const data = params.data;
  const [Amount, setAmount] = React.useState(0);
  const [OtherName, setOtherName] = React.useState(0);
  const [Duration, setDuration] = React.useState(0);
  const [OtherAmount, setOtherAmount] = React.useState();
  const [SubscriptionTypeError, setSubscriptionTypeError] = React.useState();
  const [AmountError, setAmountError] = React.useState();
  const [DurationError, setDurationError] = React.useState();
  const [OtherNameError, setOtherNameError] = React.useState();
  const [OtherAmountError, setOtherAmountError] = React.useState();
  const gigs=params.gigs;

  //console.log(data)

  React.useEffect(() => {
    if (isFocused) {
      //console.log("hidden")
      dispatch(setHideBottomBar(true));
      setTimeout(() => {
        dispatch(setHideBottomBar(true));
      }, 50);
    } else {
      //console.log("seen")
      dispatch(setHideBottomBar(false));
    }
  }, [isFocused]);
  useEffect(()=>{
    if(data){
        //console.log(data.installmentData)
        setAmount(gigs.installmentData.totalAmount.toString())
        setSubscriptionType(gigs.installmentData.installmentType)
        setDuration(gigs.installmentData.installmentCount.toString())
        setPayAsGo(gigs.installmentData.advancedPayment?gigs.installmentData.advancedPayment:false)
        setOtherName(gigs.installmentData.advancedPaymentAmount.toString())
    }
  },[isFocused])

  return (
    <KeyboardAvoidingView
      style={{ flex: 1 }}
      behavior={Platform.OS === "ios" ? "padding" : null}
      keyboardVerticalOffset={Platform.OS === "ios" ? 0 : 0}
    >
      <SafeAreaView
        style={{
          flex: 1,
        }}
      >
        <View
          style={{
            flex: 1,
          }}
        >
          <ScrollView showsVerticalScrollIndicator={false}>
            <View
              style={{
                flexDirection: "row",
                paddingHorizontal: 20,
                paddingVertical: 10,
                justifyContent: "space-between",
              }}
            >
              <View style={{}}>
                <SvgXml xml={icon} height="18" width={"18"} />
                <View style={{ height: 10 }} />
                <Text
                  style={[
                    styles.text,
                    {
                      color: "#6366F1",
                    },
                  ]}
                >
                  Add Your
                </Text>
                <Text
                  style={[
                    styles.text,
                    {
                      color: "#000000",
                    },
                  ]}
                >
                  Best
                </Text>
                <Text
                  style={[
                    styles.text,
                    {
                      color: "#DA1E37",
                    },
                  ]}
                >
                  Installment
                </Text>
                <Text
                  style={[
                    styles.text,
                    {
                      color: "#000000",
                    },
                  ]}
                >
                  Service
                </Text>
              </View>
              <View
                style={{
                  marginRight: 0,
                }}
              >
                <SvgXml xml={vectorImage} height="190" width={width / 2} />
              </View>
            </View>
            <View
              style={{
                flexDirection: "row",
                paddingHorizontal: 20,
                paddingVertical: 10,
                alignItems: "center",
              }}
            >
              <Input
                returnKeyType={"done"}
                error={AmountError}
                value={Amount}
                onChange={setAmount}
                keyboardType="number-pad"
                placeholder={"0.00৳"}
                level={"Total Amount"}
                style={{
                  width: width / 2 - 30,
                  borderWidth: 1,
                  height: 47,
                  marginHorizontal: 0,
                  marginRight: 20,
                }}
              />
              <DropDown
                error={SubscriptionTypeError}
                value={SubscriptionType}
                onChange={(e) => {
                  console.log(e);
                  setSubscriptionType(e);
                  setPayAsGo(false);
                }}
                style={{
                  width: width / 2 - 30,
                }}
                label={"Installment Type"}
                placeholder={"Select"}
                DATA={["Weekly", "Monthly", "Yearly"]}
              />
            </View>
            {SubscriptionType && (
              <View
                style={{
                  paddingVertical: 20,
                  flexDirection: "row",
                  alignItems: "center",
                }}
              >
                <Input
                  returnKeyType={"done"}
                  error={DurationError}
                  value={Duration}
                  onChange={setDuration}
                  keyboardType={"number-pad"}
                  level={"Total Installment"}
                  style={{
                    borderWidth: 1,
                    width: width / 2 - 30,
                    marginHorizontal: 0,
                    marginLeft: 20,
                  }}
                  placeholder={"Example: 12"}
                />
                <Text
                  style={{
                    fontSize: 16,
                    fontFamily: "Poppins-Medium",
                    marginLeft: 20,
                  }}
                >
                  (Max 260 {SubscriptionType.split("l")[0]})
                </Text>
              </View>
            )}
            {SubscriptionType && (
              <>
                <View
                  style={{
                    paddingHorizontal: 20,
                    paddingVertical: 0,
                  }}
                >
                  <CheckBox
                    value={PayAsGo}
                    onChange={() => {
                      setPayAsGo(!PayAsGo);
                    }}
                    style={{
                      width: 180,
                    }}
                    title={"Advanced Payment"}
                  />
                </View>
              </>
            )}
            {PayAsGo && (
              <Animated.View
                style={{
                  paddingVertical: 5,
                  marginTop: 20,
                  
                }}
                entering={FadeIn}
              >
                <View
                  style={{
                    flexDirection: "row",
                    alignItems:"center"
                  }}
                >
                  <Input keyboardType={"number-pad"}
                    error={OtherNameError}
                    value={OtherName}
                    onChange={setOtherName}
                    placeholder={"500৳"}
                    style={{
                      borderWidth: 1,
                      width: width / 2 - 30,
                      marginHorizontal: 0,
                      marginLeft: 20,
                    }}
                  />
                  <Text
                    style={{
                      width: width / 2 - 30,
                      marginLeft: 20,
                      fontSize: 12,
                    }}
                  >
                    (Advance Payment Must be Less Then Total Ammount)
                  </Text>
                </View>

                <View
                  style={{
                    height: 1,
                    backgroundColor: "#F2F2F6",
                    marginVertical: 15,
                    width:"100%"
                  }}
                />
                <Text style={{
                    marginHorizontal:20,
                    fontSize:16
                }}>Every Week Installment = {(Amount/Duration).toFixed(2)} ৳</Text>
                <View
                  style={{
                    height: 1,
                    backgroundColor: "#F2F2F6",
                    marginTop: 15,
                    width:"100%",
                    marginBottom:5
                  }}
                />
                <View style={{
                    width:"100%",
                    alignItems:"flex-end",
                    paddingHorizontal:20
                }}>
                    <Text style={{
                        fontSize:12,
                        color:"#000000"
                    }}>(Minimum Weekly Payment 50 ৳ Require) </Text>
                </View>
              </Animated.View>
            )}

            <View
              style={{
                justifyContent: "center",
                alignItems: "center",
                justifySelf: "flex-end",
                marginVertical: 30,
              }}
            >
              <IconButton
                onPress={() => {
                  setSubscriptionTypeError();
                  setAmountError();
                  setDurationError();
                  setOtherNameError();
                  setOtherAmountError();
                  if (!SubscriptionType) {
                    setSubscriptionTypeError("*This field is required");
                    return;
                  }
                  if (!Amount) {
                    setAmountError("*This field is require");
                    return;
                  }
                  if (!Duration) {
                    setDurationError("*This field is required");
                    return;
                  }
                  if (PayAsGo&& !OtherName) {
                    setOtherNameError("*This field is required");
                    return;
                  }
                 
                  navigation.navigate("EditService", {
                    direct: true,
                    type: "INSTALLMENT",
                    data: data,
                    gigs:gigs,
                    installmentData: {
                      installmentType:SubscriptionType,
                      totalAmount:Amount,
                      installmentCount:Duration,
                      advancedPaymentAmount:OtherName,
                      advancedPayment:true
                    },
                  });
                }}
                style={{
                  marginHorizontal: 20,
                  height: 35,
                  backgroundColor: "#4ADE80",
                  width: width - 40,
                }}
                title={"Next"}
              />
              <View style={{height:40}}/>
            </View>
          </ScrollView>
        </View>
      </SafeAreaView>
    </KeyboardAvoidingView>
  );
}
